        fetch('http://localhost:8082/get-data-product')
      .then(function(response){
        return response.json(); })
      .then(function(data){
        setFooter(data); 
    })
    }
    const del =(id)=>{
        fetch(`http://localhost:8082/del-data/${id}`,{
          method: "DELETE",
        })
        .then(function(response){;
          return response.json(); })
          .then(function(data){
            Show();
      })
      };

